import {
    COUNT_YEAR
} from './const'

type PropertiesType<T> = T extends { [key: string]: infer U } ? U : never

type GetActionsTypes<T extends { [key: string]: (...args: any[]) => any }> = ReturnType<PropertiesType<T>>

export const actions = {
    setCounterYear: (year: string) => ({ type: COUNT_YEAR, year } as const),
    setInitialAmount: (amount: string) => ({ type: COUNT_YEAR, amount } as const),
    setReplenishment: (replenishment: string) => ({ type: COUNT_YEAR, replenishment } as const),
    setPeriodicity: (Periodicity: string) => ({ type: COUNT_YEAR, Periodicity } as const),
    setInterestAccruals: (interestAccruals: string) => ({ type: COUNT_YEAR, INTERESTACCRUALS  } as const),
}

export type ActionsTypes = GetActionsTypes<typeof actions>
